package se.lnu.http.client;

import java.io.BufferedReader;
import java.io.BufferedWriter;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.OutputStreamWriter;
import java.net.InetSocketAddress;
import java.net.Socket;


public class SocketClient {
	private HTTPGetProtocoll client;
	private Socket socket;

	public SocketClient(Socket echoSocket, HTTPGetProtocoll client) {
		this.socket = echoSocket;
		this.client = client;
	}

	public String get(String hostName, int portNumber, String file) throws IOException {
		
		try {
			InetSocketAddress endpoint = new InetSocketAddress(hostName, portNumber);
			socket.connect(endpoint, 100);
			BufferedWriter writer = new BufferedWriter(new OutputStreamWriter(socket.getOutputStream()));
			BufferedReader reader = new BufferedReader(new InputStreamReader(socket.getInputStream()));
			
			String data = client.doGet(hostName, file, writer, reader);
			
			socket.close();
			
			return data;
		} catch (IOException e) {
			socket.close();
			throw e;
		}		
		
	}
}

package se.lnu.http.client;

import java.io.BufferedReader;
import java.io.BufferedWriter;
import java.io.IOException;

import se.lnu.http.HTTPReader;

public class HTTPGetProtocoll {
	

	String doGet(String hostName, String file,
			BufferedWriter outWriter, BufferedReader reader) throws IOException {
		outWriter.write("GET " + file + " HTTP/1.1\r\nHost: " + hostName + "\r\nConnection: close\r\n\r\n");
		outWriter.flush();
		
		HTTPReader httpReader = new HTTPReader(reader);
		String data = httpReader.readAll();
		data += httpReader.readAll();
		return data;
	}

	
}

package se.lnu.http;

import java.io.File;
import java.io.FileNotFoundException;
import java.io.IOException;

public class SharedFolder {

	volatile private File sharedDirectory;
	

	public SharedFolder(File sharedDirectory) {
		assert(sharedDirectory.isDirectory());
		this.sharedDirectory = sharedDirectory;
	}

	public File getURL(String relativePath) throws IOException {
		
		//default file
		if (relativePath.endsWith("/")) {
			relativePath += "index.html";
		}
		File file = new File(sharedDirectory, relativePath);
		
		String absolute = sharedDirectory.getAbsolutePath();
		String sharedFileCanonicalPath = file.getCanonicalPath();
		String startOfFile = sharedFileCanonicalPath.substring(0, absolute.length());
		if (startOfFile.equals(absolute) == false) {
			throw new SecurityException();	
		}
		if (file.exists()) {
			return file;
		}
		
		throw new FileNotFoundException();
		
	}

}

