package se.lnu.http;


import se.lnu.http.Header.HTTPHeader;
import se.lnu.http.exceptions.MalformedRequestException;

public class Header {
	
	public enum HTTPHeader {
	    Host("Host"), 
	    ContentType("Content-Type"), 
	    ContentLength("Content-Length"), 
	    Connection("Connection"),
	    CacheControl("Cache-Control"),
	    Accept("Accept"),
	    UserAgent("User-Agent"),
	    AcceptEncoding("Accept-Encoding"),
	    AcceptLanguage("Accept-Language"),
	    UnknownHeader("Unknown-Header");
	    
	    String headerText;
	    private HTTPHeader(String headerText) {
	    	this.headerText = headerText;
	    }
	    
	    
	}

	private String value;
	private HTTPHeader type;
	
	public Header(HTTPHeader type, String value) {
		this.value = value;
		this.type = type;
	}
	
	public String getValue() {
		return value;
	}

	public HTTPHeader getType() {
		return type;
	}

	static Header fromString(String stringHeader) throws MalformedRequestException {
		String[] parts = stringHeader.split(": ");
    	if (parts.length != 2) {
    		throw new MalformedRequestException("unknown format of Header ["+stringHeader+"]");
    	}
		
		for(HTTPHeader m : HTTPHeader.values()) {
    		if (stringHeader.startsWith(m.headerText)) {
    			return new Header(m, parts[1]);
    		}
    	}
    	
    	
    	//
    	return new Header(HTTPHeader.UnknownHeader, parts[1]);
    }

	
	
}

package se.lnu.http;

import java.io.File;
import java.net.BindException;

import se.lnu.http.exceptions.InvalidPortException;
import se.lnu.http.view.ConsoleView;


public class HTTPServerConsole {
	private ConsoleView view;
	private ServerFactory factory;

	public HTTPServerConsole(ConsoleView view, ServerFactory factory ) {
		this.view = view;
		this.factory = factory;
	}

	/**
	 * @param args
	 * @throws Exception 
	 */
	public static void main(String[] args) throws Exception {
		ConsoleView view = new ConsoleView(args);
		ServerFactory factory = new ServerFactory();
		HTTPServerConsole server = new HTTPServerConsole(view, factory);
		server.runConsole();
		
		
	}

	void runConsole() throws Exception {
		
		try {
			Port port = view.getPort();
			File sharedDirectory = view.getDirectory();
			HTTPServer server = factory.create(port, sharedDirectory, view);
			
			server.start();
			
			while(true) {
				if (view.doStop()) {
					server.stop();
					break;
				}
			}
			
		} catch (InvalidPortException e) {
			view.showhelp();
		} catch (BindException e) {
			view.showPortTaken();
		}
		
	}

}

package se.lnu.http;

import java.io.IOException;
import java.net.ServerSocket;

import se.lnu.http.exceptions.NotStartedException;


public class HTTPServer {

	
	private IServerWatcher watcher;
	
	private Port port;
	private AcceptThread acceptThread;

	private SharedFolder sharedDirectory;

	public HTTPServer(Port port, SharedFolder sharedDirectory, IServerWatcher watcher) {
		this.watcher = watcher;
		watcher.serverConstructed();
		this.port = port;
		this.sharedDirectory = sharedDirectory;
	}

	public void start() throws IOException {
		ServerSocket socket = new ServerSocket(port.getPort());
		ClientFactory factory = new ClientFactory(this.sharedDirectory, watcher);
		acceptThread = new AcceptThread(socket, watcher, factory);
		
		acceptThread.start();
		
		watcher.serverStarted();
	}

	public void stop() throws NotStartedException, InterruptedException, IOException {
		if (acceptThread == null)
			throw new NotStartedException();
		
		acceptThread.stopme();
		
		while(acceptThread.isAlive()) {
			Thread.sleep(100);
		}
		
		
		watcher.serverStopped();
		
		acceptThread = null;
	}

}

package se.lnu.http;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

import se.lnu.http.exceptions.MalformedRequestException;

public class HTTPRequestParser {

	public static HTTPRequest parseRequest(String requestString) throws MalformedRequestException {
		
		String[] lines = requestString.split("\r\n");
		
		String firstLine = lines[0];
		String[] requestType = firstLine.split(" ");
		if (requestType.length != 3) {
			throw new MalformedRequestException(requestString);
		}
		
		HTTPRequest.Method method = HTTPRequest.Method.fromString(requestType[0]);
		
		Map<Header.HTTPHeader,Header> headers = new HashMap<Header.HTTPHeader,Header>();
		for (int i = 1; i < lines.length; i++) {
			Header h = (Header.fromString(lines[i]));
			headers.put(h.getType(), h);
		}
		
		return new HTTPRequest(method, requestType[1], headers);
	}


}

package se.lnu.http;

import java.util.Map;

import se.lnu.http.exceptions.*;

public class HTTPRequest {
	//http://en.wikipedia.org/wiki/Hypertext_Transfer_Protocol
	public enum Method {
	    GET, HEAD, POST, PUT, DELETE, TRACE, OPTIONS, CONNECT, PATCH;
	    
	    static Method fromString(String stringMethod) throws MalformedRequestException {
	    	for(Method m : Method.values()) {
	    		if (stringMethod.equals(m.name())) {
	    			return m;
	    		}
	    	}
	    	throw new MalformedRequestException("unknown method ["+stringMethod+"]");
	    	
	    }
	}
	
	

	
	
	
	
	private String url;
	private Method requestType;
	private Map<Header.HTTPHeader, Header> headers;

	public HTTPRequest(Method requestType, String url, Map<Header.HTTPHeader, Header> headers) throws MalformedRequestException {
		this.url = url;
		this.requestType = requestType;
		this.headers = headers;
		
		
		if (headers.containsKey(Header.HTTPHeader.Host) == false) {
			throw new MalformedRequestException("no header found");
		}
	}

	public String getURL() {
		return this.url;
	}

	public Method getMethod() {
		return requestType;
	}

	public boolean doCloseAfterResponse() {
		
		if ( headers.containsKey(Header.HTTPHeader.Connection) ) {
			if (headers.get(Header.HTTPHeader.Connection).getValue().contains("close")) {
				return true;
			}
		}
		return false;
	}

}

package se.lnu.http;

import java.io.BufferedReader;
import java.io.IOException;

public class HTTPReader {
	private int contentlength = 0;
	
	BufferedReader reader;
	
	public HTTPReader(BufferedReader reader) {
		this.reader = reader;
	}

	private String readBody() throws IOException {
		StringBuilder data = new StringBuilder();
		for (int i = 0; i < contentlength; i++) {
			data.append((char)reader.read());
		}
		
		return data.toString();
	}

	public String readAll() throws IOException {
		StringBuilder data = new StringBuilder();
				
		while (true) {
			String lineRead = reader.readLine();
			
			if (lineRead == null) { //eof http://docs.oracle.com/javase/1.4.2/docs/api/java/io/BufferedReader.html
				throw new IOException("eof");
			}
			
			data.append(lineRead);
			data.append("\r\n");
			if (lineRead == null || lineRead.equals("\r\n") || lineRead.equals("")) {
				break;
			}
			if (lineRead.startsWith("Content-Length:")) {
				String number = lineRead.substring(16);
				contentlength  = Integer.parseInt(number); 
			}
			
		}
		
		return data.toString() + readBody();
	}
}

package se.lnu.http;

import java.io.IOException;
import se.lnu.http.exceptions.MalformedRequestException;
import se.lnu.http.response.HTTPResponse;


public class ClientThread extends Thread{
	
	
	private ClientSocket clientSocket;
	private ResponseFactory factory;
	private IServerWatcher watcher;
	private int identifier;
	public static int timeOutMilliseconds = 10000;

	public ClientThread(ClientSocket clientSocket,
						ResponseFactory factory, 
						IServerWatcher watcher, int identifier) {
		this.clientSocket = clientSocket;
		
		this.factory = factory;
		this.watcher = watcher;
		this.identifier = identifier;
	}
	
	public void run() {
		 
		watcher.startedClient(identifier);
		try {
			while(singleRequest());
			
		} catch (IOException e) {
			//connection broken
			
		}
		
		try {
			clientSocket.close();
		} catch (IOException e) {
			e.printStackTrace();
		}
		
		watcher.connectionBroken(identifier);
		
	}

	private boolean singleRequest() throws IOException {
		boolean doContinue = true;
		String requestString = clientSocket.getRequest(timeOutMilliseconds);
		HTTPResponse response;
		try {
			HTTPRequest request = HTTPRequestParser.parseRequest(requestString);
			
			
			if (request.doCloseAfterResponse()) {
				doContinue = false;
			}
			
			response = factory.getResponse(request);
		} catch (MalformedRequestException e) {
			response = factory.getBadResponse();
			doContinue = false;
		}
	
		response.writeResponse(clientSocket, doContinue);
		
		return doContinue;
	}
}

package se.lnu.http;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.net.Socket;

public class ClientSocket {
	
	private Socket sock;

	public ClientSocket(Socket sock) {
		this.sock = sock;
		
	}

	public String getRequest(int timeOutMilliseconds) throws IOException {
		
		sock.setSoTimeout(timeOutMilliseconds);
		BufferedReader in = new BufferedReader(new InputStreamReader(sock.getInputStream()));
		HTTPReader httpReader = new HTTPReader(in);
		String requestString = httpReader.readAll();
		return requestString;
	}

	public void writeHeader(String response) throws IOException {
		PrintWriter out = new PrintWriter(sock.getOutputStream(), true);
		out.write(response.toString());
		out.flush();
	}

	public void close() throws IOException {
		sock.close();
		
	}

	public void writeBody(byte[] bytes) throws IOException {
		sock.getOutputStream().write(bytes);
	}

}

package se.lnu.http;

import java.net.Socket;

public class ClientFactory {
	
	private SharedFolder folder;
	private IServerWatcher watcher;
	private int numberOfClients;

	ClientFactory(SharedFolder folder, IServerWatcher watcher) {
		this.folder = folder;
		this.watcher = watcher;
		numberOfClients = 0;
	}

	public ClientThread createClient(Socket clientSocket ) {
		numberOfClients++;
		return new ClientThread(new ClientSocket(clientSocket), new ResponseFactory(folder, watcher, numberOfClients), watcher, numberOfClients);
	}

}

package se.lnu.http;

import java.io.IOException;
import java.net.ServerSocket;
import java.net.Socket;
import java.net.SocketException;

public class AcceptThread extends Thread{

	volatile ServerSocket socket;
	volatile private IServerWatcher observer;
	private ClientFactory cfactory;
	
	public AcceptThread(ServerSocket sock, 
						IServerWatcher observer, 
						ClientFactory cfactory) {
		socket = sock;
		this.observer = observer;
		this.cfactory = cfactory;
	}
	
	public void stopme() throws IOException {
		socket.close();
	}
	
	public void run() {
        
        	
        	while (true) {
        		try {
        			acceptClient();
        		} catch (SocketException e) {
        			//when stopme is called we get a socket exception
        			break;
                } catch (IOException e) {
        			e.printStackTrace();
                }
				
				
        	}
        	
        	observer.closedAccept();
        	
		
    }

	private void acceptClient() throws IOException {
		observer.waitForClient();
		Socket clientSocket = socket.accept();
		ClientThread client = cfactory.createClient(clientSocket);
		client.start();
		
	} 
	
}
